long_desc.thetext:
When the SelectBox is in a "qx.ui.container.Scroll" container and the scroll bar is moved with "mousewheel", the SelectBox list is not moved or closed. See also screen shot.

Code:

main : function() {
  this.base(arguments);

  var container = new qx.ui.container.Composite(new qx.ui.layout.VBox(2));
  var box = this.createBox();

  var widget1 = new qx.ui.core.Widget().set({
    width: 400,
    height: 300,
    backgroundColor: "red"
  });

  var widget2 = new qx.ui.core.Widget().set({
    width: 400,
    height: 300,
    backgroundColor: "green"
  });

  var scroll = new qx.ui.container.Scroll().set({
    width: 400,
    height: 300
  });

  container.add(widget1);
  container.add(box);
  container.add(widget2);
  scroll.add(container);

  this.getRoot().add(scroll, {left : 20, top : 20})
},

createBox : function() {
  var selectBox = new qx.ui.form.SelectBox();
  for (var i=0; i<30; i++)
  {
    var tempItem = new qx.ui.form.ListItem("Item " + (i+1));
    selectBox.add(tempItem);

    // select sixth item
    if (i == 5) {
      selectBox.setSelected(tempItem);
    }
  }

  return selectBox;
}
